import './loginpage.css';
import React, { useEffect, useState } from 'react';
import SignInForm from './SignInForm.jsx';
import SignUpForm from './SignUpForm.jsx';

function Loginpage() {
    const [formToShow, setFormToShow] = useState(null);


    function togglePop(formType) {
        setFormToShow(formToShow === formType ? null : formType);
    }


    return (
        <div className="login_page">
            <div className="login_buttons">
                <h1 className="heading_1">WHATS ON TODAY</h1>
                <div className='join_share_buttons'>
                    <h1 className="heading_2">Join and share</h1>
                    <button className="login" onClick={() => togglePop("signIn")}>Sign in</button>
                    {formToShow === "signIn" && <SignInForm toggle={() => togglePop("signIn")} />}
                    <button className="sign_up" onClick={() => togglePop("signUp")}>Create account</button>
                    {formToShow === "signUp" ? <SignUpForm toggle={() => togglePop("signUp")} /> : null}
                </div>

            </div>
            <div className="logo">
                <img className='logo_img' src={`data:image/png;base64,`} alt="logo" />
            </div>
        </div>

    );
}

export default Loginpage;
